import React from "react";

import { EuiText, EuiCard, EuiFlexGroup, EuiFlexItem } from "@elastic/eui";

const Card = (props) => (
  <EuiFlexItem>
    <EuiCard
      textAlign="left"
      image={
        <div>
          <img
            src={props.item.media.thumbnail[0].url}
            alt=""
            height="100px"
            width="100px"
          />
        </div>
      }
      title={props.item.name}
      description={props.item.description_text}
      footer={
        <EuiFlexGroup justifyContent="flexEnd">
          <EuiFlexItem grow={false}>
            <EuiText size="s">
              <p>Starts at {props.item.price.offer_price.value}</p>
            </EuiText>
          </EuiFlexItem>
        </EuiFlexGroup>
      }
    />
  </EuiFlexItem>
);

export default Card;
